    int category(int n, int m) {
        if (n << 1 < m) {
            return n & 1;
        }
        if ((n + m & 1) == 1) {
            return 2;
        }
        return 3 + (n & 1);
    }

    int inverse(int a) {
        assert a != 0;
        return a == 1 ? 1 : (int)((long)(MOD - MOD / a) * inverse(MOD % a) % MOD);
    }

    int power(int a, int n) {
        return n == 0 ? 1 : (int)((long)a * power(a, n - 1) % MOD);
    }

    int residue(int a) {
        return (a % MOD + MOD) % MOD;
    }

    int solve(int n, int m, int k) {
        if (n > m) {
            return solve(m, n, k);
        }
        assert n <= m;
        int result = 0;
        for (int[] item : COEFFICIENT[(k - 1) * 5 + category(n, m)]) {
            result += (int)((long)residue(item[0]) * inverse(item[1]) % MOD * power(n, item[2]) % MOD * power(m, item[3]) % MOD);
            result %= MOD;
        }
        return result;
    }

    public void run() {
        InputReader reader = new InputReader(System.in);
        PrintWriter writer = new PrintWriter(System.out);
        try {
            int n = reader.nextInt();
            int m = reader.nextInt();
            int k = reader.nextInt();
            writer.println(solve(n, m, k));
        } catch (IOException e) {
        } finally {
            writer.close();
        }
    }

    class InputReader {
        InputReader(InputStream in) {
            this.reader    = new BufferedReader(new InputStreamReader(in));
            this.tokenizer = new StringTokenizer("");
        }

        public String nextToken() throws IOException {
            while (!tokenizer.hasMoreTokens()) {
                tokenizer = new StringTokenizer(reader.readLine());
            }
            return tokenizer.nextToken();
        }

        public int nextInt() throws IOException {
            return Integer.parseInt(nextToken());
        }

        private BufferedReader  reader;
        private StringTokenizer tokenizer;
    }

    private void debug(Object...o) {
        System.err.println(Arrays.deepToString(o));
    }
